import React from "react";

import {
  Container,
  Button,
  ButtonGroup,
  Center,
  Square,
  Circle,
  Box,
  Flex, Spacer 
} from "@chakra-ui/react";

const Landing = () => {
  return (
    <div>
      <box>
        {" "}
        <Button colorScheme="blue">Login/Signup</Button>
      </box>

      <center>
        <header> Fantastic Happiness!</header>
      </center>
<Flex>
      <Box as='button' bg = "red"> Dev Profile </Box>
      <Spacer/>
      <Box as='button'> Dev Profile </Box>
      <Spacer/>
      <Box as='button'> Dev Profile </Box>
      <Spacer/>
      <Box as='button'> Dev Profile </Box>
  </Flex>
    </div>
  );
};

export default Landing;
